css:
atom-panel .npm-install {
  overflow-y: scroll;
  padding: 10px;
  font-size: 8px;
  font-family: monospace;
  white-space: pre;
  height: 100%;
  width: 20vw;
  max-width: 400px;
  background-color: #000;
  position: relative;
  border-top: 1px solid rgba(255, 255, 255, 0.07);
  text-shadow: none;
  color: #ccc;
}
atom-panel .npm-install .terminal {
  position: absolute;
  bottom: 10px;
}
